import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';



class CounterApp extends Component {
  state = {
    counter: 0
  };
  render() {
    return (
      <div >
        <div>
          <h2>{this.state.counter}</h2>
        </div>
        <div>
          <button > + </button>
          <button type="button"> reset </button>
          <button type="button"> - </button>
        </div>
      </div>
    );
  }
}

export default CounterApp;
